graph_hundertwasser_comment_en(1,'Alfred Schmeller (Vizepr&Atilde;&curren;sident des Art Club, 1951/52, Anm.) wollte billige, f&Atilde;&frac14;r jeden erschwingliche Graphik-Mappen herausbringen. Die Maler Josef Mikl und Johann Fruhmann, ich glaube auch Kurt Moldovan, sagten ebenfalls zu. Das Druckverfahren Zinklithographie auf einer Walze war neu in Wien. Der Preis betrug zehn Schilling pro Mappe mit je zehn Bl&Atilde;&curren;ttern, also ein Schilling pro Blatt. Jahrelang wollte niemand meine Mappe kaufen, nur Fritz Wotruba kam einmal in den Strohkoffer, spendete zwanzig Schilling, wollte die Mappe aber nicht mitnehmen.').
graph_hundertwasser_comment_en(18,'Hans Neuffer war ein ganz junger Mann, als ich ein eigenartiges Selbstportr&Atilde;&curren;t von ihm in einer Buchhandlung sah, das mich sehr beeindruckte. Ich fragte, wer es war und lernte ihn kennen. Seine Bilder waren au&Atilde;ÂŸerhalb jeglicher Norm, teilweise sogar auf Zeitungspapier (!) gemalt und sicherlich f&Atilde;&frac14;r jeden Kunstkenner total inakzeptabel. Er war schlaksig, hatte gro&Atilde;ÂŸe H&Atilde;&curren;nde, war aus b&Atilde;&frac14;rgerlicher Familie und wollte Unb&Atilde;&frac14;rgerliches tun. Durch ihn lernte ich viel sp&Atilde;&curren;ter Udo Proksch kennen, der noch viel zwielichtiger war. Beide taten Sachen, die alle Gepflogenheiten sprengten. Ich ging eine Wette mit Udo und auch Neuffer ein. Wer wohl mehr Einflu&Atilde;ÂŸ gewinnt und Macht bekommt, ich mit meiner Malerei oder sie mit Geld, Politik und Waffen. Udo ist lebenslang in Haft und Neuffer starb eines seltsamen Todes. Wer hat die Wette gewonnen? Was Udo Proksch betrifft: Ihm wird zur Last gelegt, zwecks Versicherungsbetrugs das Schiff &quot;Lucona&quot; im Indischen Ozean versenkt zu haben, wobei sechs Seeleute ertranken. Dazu mu&Atilde;ÂŸ ich wahrheitsgem&Atilde;&curren;&Atilde;ÂŸ sagen, da&Atilde;ÂŸ in seiner Brust wohl zwei Seelen stecken m&Atilde;&frac14;ssen. Er hat seine Position als Liebkind der &Atilde;&para;sterreichischen Regierung ausgenutzt, um auch Gutes zu tun, z. B. einen Polizei&Atilde;&frac14;berfall auf die Aubesetzer (Hainburg, 1984, Anm.) zu verhindern. Auch habe ich ihm zu verdanken, da&Atilde;ÂŸ er mithalf, Treffen zwischen mir, Bundeskanzler Kreisky und B&Atilde;&frac14;rgermeister Gratz zu beschleunigen, in denen es um den Bau des &quot;Hundertwasserhauses&quot; ging. So habe ich direkt / indirekt mit vier Schiffen zu tun: die &Atilde;Âœberfuhr zur Rossauerl&Atilde;&curren;nde, die &quot;SS Bauta&quot;, auf der ich Matrose war, die &quot;Regentag&quot;, mit der ich nach Neuseeland segelte, und, wenn auch entfernt, mit der &quot;Lucona&quot;. (siehe auch 529 Spiral with Neuffer Heads)').
graph_hundertwasser_comment_en(24,'Mich hat die typisch franz&Atilde;&para;sische Art und Weise des Graphik-Edition-Betruges sehr aufgebracht. Ich wollte mit gutem Beispiel vorangehen, es ehrlich machen und ein Exempel setzen. Es war (und ist) gang und g&Atilde;&curren;be, da&Atilde;ÂŸ man eine Graphik-Edition mehrmals aufteilt und einzeln numeriert, um so eine kleine Auflage vorzut&Atilde;&curren;uschen. Diese aufgeteilten, jedesmal von vorne neu numerierten Teilserien, mit dem Anspruch einer alleinigen Edition des betreffenden Blattes hatten Phantasienamen wie: grand marge (dasselbe auf gr&Atilde;&para;&Atilde;ÂŸerem Papier gedruckt), pour l&#039;artiste (wieder dasselbe), epreuve d&#039;artiste (wieder dasselbe und keine echten Proben), h.c. - hors commerce (was dennoch in den Handel kam) auf verschiedenen, auch anders farbigen Papieren, &quot;auf Japan&quot;, &quot;auf B&Atilde;&frac14;tten&quot;, signiert, drucksigniert, als Plakatdruck (dasselbe nochmals auf schlechtem Papier gedruckt), dazu noch die Normalauflage (m&Atilde;&para;glichst klein). Wenn man alle diese Spezialdrucke derselben Graphik zusammenz&Atilde;&curren;hlt, kommt man auf ein Vielfaches der angegebenen Editionsh&Atilde;&para;he. Ich habe das getan, was mir den Zorn der franz&Atilde;&para;sischen Graphikh&Atilde;&curren;ndlerwelt einbrachte: Ich habe ganz einfach alles durchnumeriert und auf jedem Blatt die tats&Atilde;&curren;chliche Auflagenh&Atilde;&para;he angegeben.').
graph_hundertwasser_comment_en(34,'Dies war der Beginn einer langen Zusammenarbeit mit meinem Freund, dem &quot;Coordinatore&quot; Alberto Della Vecchia. Bis jetzt hatte ich mich dagegen gewehrt, Graphiken zu machen. Was bisher entstand, war quasi gezwungenerma&Atilde;ÂŸen entstanden. Bis Alberto mir eine von ihm gestaltete &quot;Hundertwassergraphik&quot; brachte. Mir wurde gleich &Atilde;&frac14;bel: ein mich nach&Atilde;&curren;ffender Kitsch. Trotzdem war es der entscheidende Ansto&Atilde;ÂŸ, es besser und richtig zu machen. So entstand &quot;King Kong&quot;.').
graph_hundertwasser_comment_en(36,'Eine Hommage an Walter Kampmann, der mir die Seelenb&Atilde;&curren;ume geschenkt hat. Er starb, als die Rote Armee einmarschierte, 1945 &Atilde;&para;stlich von Berlin. Es w&Atilde;&curren;re sch&Atilde;&para;n, ihm im Regen unter seinen Seelenb&Atilde;&curren;umen zu begegnen.').
graph_hundertwasser_comment_en(40,'Ich war immer sehr gl&Atilde;&frac14;cklich, wenn ich verschiedene Ausdrucksformen, die ich geschaffen hatte, miteinander verbinden konnte. Dies ist das Schiff Regentag und die Spirale als Wasserstrudel. Es ist sch&Atilde;&para;n, sich auf eigene Sch&Atilde;&para;pfungen st&Atilde;&frac14;tzen zu k&Atilde;&para;nnen. Es ist das eigene Land, auf dem man steht und in dem man herumgehen kann.').
graph_hundertwasser_comment_en(41,'Dies ist meine erste durchnumerierte Gro&Atilde;ÂŸauflage, die eigentlich gar keine ist, da sie aus vielen Variationen besteht. Der Ursprung ist 151 Bleeding Houses. Ich habe Monate in der Druckerei in Campalto verbracht, w&Atilde;&curren;hrend ich auf der &quot;Regentag&quot; nicht weit davon in einem Kanal der Lagune bei Ca&#039;Noghera lag. Es war wie ein Simultan-Schachspiel mit &Atilde;&frac14;ber vierzig Gegnern. Ich tat dies noch konsequenter mit dem sp&Atilde;&curren;teren Siebruck 860 Homo Humus come va. Ich glaube nicht, da&Atilde;ÂŸ mir jemand dieses gigantische Unternehmen gleichtun kann, das mich zwei Jahre beanspruchte. Ich verwendete v&Atilde;&para;llig neue Techniken in der Druckgraphik: Metallpr&Atilde;&curren;gedruck, Phosphorfarben, die in der Nacht leuchten, reflektierende Glasperlen-Aufdrucke, konvexe Pr&Atilde;&curren;gungen und eine unglaubliche Anzahl von Farb&Atilde;&frac14;berdrucken, die ich einzeln auf Transparentfolien malte und die dann auf Sieb &Atilde;&frac14;bertragen wurden. Dann die Probedrucke der unendlich gewordenen Farbkombinationen. Ich wollte das Flie&Atilde;ÂŸband ad absurdum f&Atilde;&frac14;hren. In die Enge getrieben, zwischen einer unglaublich einsetzenden Nachfrage und meinem Stolz, Originale und nicht Massenware zu schaffen, und bestrebt, soviel von meinem inneren Selbst wie nur m&Atilde;&para;glich zu geben. Es kam zu einem Proze&Atilde;ÂŸ, den ich auch gewann, weil ich die Preise (wie bei der Art-Club-Mappe 1951) niedrig halten wollte - 100 Mark pro Blatt, damit es vielen zug&Atilde;&curren;nglich ist. Es war verlorene M&Atilde;&frac14;he. Den freien Marktwert konnte ich nicht bestimmen. Es war Sieg und Niederlage zugleich.').
graph_hundertwasser_comment_en(53,'Eine eigenartige Premonition [Vorwarnung]: Die Blutstropfen auf dem Poster malte ich vor dem Massaker w&Atilde;&curren;hrend der Olympischen Spiele. Als Vorlage diente mein Bild 147 Das Match des Jahrhunderts. Mitten hinein malte ich die orthodoxe Kirche, die &quot;V&Atilde;&curren;terchen Timofej&quot;, ein eigenwilliger, selbsternannter russischer Pope, gegen alle Baubewilligungen gerade dort baute, wo die Olympischen Spiele stattfinden w&Atilde;&frac14;rden. Die Liebe der M&Atilde;&frac14;nchner verhinderte jedoch den Abri&Atilde;ÂŸ der Kirche Timofejs. Ich habe ihn &Atilde;&para;fters besucht und seine Zwiebelt&Atilde;&frac14;rme, die mit glitzerndem Stanniolschokoladepapier beschichtet waren. Ich f&Atilde;&frac14;hlte meinen Hang zu Gold und Silber und Metallpr&Atilde;&curren;gungen best&Atilde;&curren;tigt.  Es war ein heiliges Gef&Atilde;&frac14;hl.').
graph_hundertwasser_comment_en(55,'Eines der wenigen Bilder, die ich mit anderen Malern zusammen malte wie mit Br&Atilde;&acute; bzw. wo andere meinen Bildern nur etwas hinzuf&Atilde;&frac14;gten wie Neuffer oder Kito. Bei diesem Siebdruck habe ich nur die Umrandung und die untere Leiste gestaltet und die &Atilde;Â„pfel in Metallpr&Atilde;&curren;gung gedruckt. Sonnenstern schuf einen Adam, einen Mann mit Kopf, jedoch verdorrt und &Atilde;&para;de, und diese Frau, Eva, zwar ohne Kopf, jedoch voll mit Fr&Atilde;&frac14;chten und Bl&Atilde;&frac14;ten.').
graph_hundertwasser_comment_en(64,'Meine Aufteilung der Druckgraphik-Herstellung war voll im Gange: Japan war zust&Atilde;&curren;ndig f&Atilde;&frac14;r Holzschnitte, Paris f&Atilde;&frac14;r Lithographien, Venedig f&Atilde;&frac14;r Seidensiebdrucke und Wien f&Atilde;&frac14;r Radierungen und Kupferstiche. Ich glaube, es gibt keine bessere Einteilung und Benutzung der traditionellen Meisterschaft in den einzelnen Sparten der Druckgraphik.').
graph_hundertwasser_comment_en(67,'Der Tod der tausend Fenster (1964) Der gr&Atilde;&frac14;ne Regen f&Atilde;&curren;llt. Der gr&Atilde;&frac14;ne Regen f&Atilde;&curren;llt nur auf lila D&Atilde;&curren;cher. Der gr&Atilde;&frac14;ne Regen rinnt nur &Atilde;&frac14;ber schwarze Mauern. Der gr&Atilde;&frac14;ne Regen rinnt in tausend verl&Atilde;&para;schende Fenster. Der gr&Atilde;&frac14;ne Regen f&Atilde;&frac14;llt tausend Wohnungen mit Smaragd.  Die Sonne ist nur sch&Atilde;&para;n, wenn sie sinkt. Die Sonne ist am sch&Atilde;&para;nsten, wenn es regnet. Fenster sind am sch&Atilde;&para;nsten, wenn es regnet. Fenster sind am sch&Atilde;&para;nsten, wenn sie Fieber haben und sterben. Wasser ist am sch&Atilde;&para;nsten, wenn lebendes Fensterglas tief im Wasser versinkt.  Die Pr&Atilde;&curren;rie bedeckt den Regen mit ihrer gr&Atilde;&frac14;nen Haut. Die Pr&Atilde;&curren;rie kennt alle tausend Fenster. Stolpere nicht &Atilde;&frac14;ber die Wellen. Gehe vorsichtig &Atilde;&frac14;ber die Pr&Atilde;&curren;rie, damit das Gr&Atilde;&frac14;n nicht zerbricht.  (verfa&Atilde;ÂŸt 1964, aus: W. Schurian (Hrsg.), Hundertwasser - Sch&Atilde;&para;ne Wege, gedanken &Atilde;&frac14;ber kunst und Leben, M&Atilde;&frac14;nchen 1983, S. 154)').
graph_hundertwasser_comment_en(78,'Als Karl-May-Winnetou-Leser, in jungen Jahren, hat mich die Indianertrag&Atilde;&para;die sehr bewegt, und Gedanken und Bilder zu diesem Thema kommen seltsam ver&Atilde;&curren;ndert, spontan daher, so &Atilde;&curren;hnlich wie auch meine Dalai-Lama-Tibet-Bilder. Es sind keine direkten Kampf- und Anklagebilder, sondern im Unterbewu&Atilde;ÂŸtsein transformierte Traumbilder. Wie das im Wachzustand entsteht, kann ich nicht erkl&Atilde;&curren;ren. (siehe auch 586)').
graph_hundertwasser_comment_en(82,'Diese Signaturtage sind nicht als Arbeitstage auf der R&Atilde;&frac14;ckseite angegeben. Um Entspannungspausen f&Atilde;&frac14;r die Finger und den Geist einzulegen, hat Hundertwasser, bei bedeutenden Signaturetappennummern angelangt, das Signieren unterbrochen und ist mit Alberto einen Kaffee trinken gegangen, ins Arkadencaf&Atilde;&copy; Bella Venezia, oder eine Sektflasche wurde zu diesem Anla&Atilde;ÂŸ bereitgehalten, aber nicht getrunken. Hundertwasser hat den Datumstempel gesetzt und in selbstgemachter Tusche signiert, in Tusche, die er aus fl&Atilde;&frac14;ssigem Ru&Atilde;ÂŸ gewonnen hat, das aus seinem Ofenrohr tropft. Er hat die Gummistempel 10002 &Atilde;&frac14;ber die Zahlen 10001 gesetzt und die japanischen Stempel mit dem japanischen Stempelkissen (Inkan) angebracht. Es wurden jeweils 10 Bl&Atilde;&curren;tter abgez&Atilde;&curren;hlt und jeweils 50 Exemplare in Reihen von f&Atilde;&frac14;nf mal zehn St&Atilde;&frac14;ck auf einem langen Tisch in einem separaten Zimmer aufgelegt, um die Signatur und Stempelarbeit zu erleichtern. Je zehn St&Atilde;&frac14;ck &Atilde;&frac14;bereinandergef&Atilde;&curren;cherte Graphiken wurden dann zum Trocknen der Ru&Atilde;ÂŸtintensignatur und der japanischen Stempel in die Siebdruckerei zur&Atilde;&frac14;ckgetragen und auf Trockenf&Atilde;&curren;cher gelegt. Alberto half dabei. (aus: Brosch&Atilde;&frac14;re zu 860 Homo Humus come va, Die Galerie, Offenbach am Main, 1984) Das war eine Anstrengung, die schwer nachvollziehbar ist: zehntausend Originale innerhalb einer Edition. Das Signieren allein dauerte achtzehn Tage, innerhalb von zwei Monaten.').
graph_hundertwasser_comment_en(83,'Bienen sehen viele Bilder gleichzeitig. Die Stadt mit ihren vielen Fenstern spiegelt sich im Stadtmenschengesicht - das bin anscheinend ich. Wenn Picasso Gesichter aufklappen kann, so kann man auch auf dem Gesicht darstellen, was das Gesicht sieht. Das, was man sieht, und die Umwelt vereinigen sich sowieso mit der Seele dessen, der davon umgeben ist. Daher wird man h&Atilde;&curren;&Atilde;ÂŸlich und krank, wenn man optischer Umweltverschmutzung ausgesetzt ist. Das lernt man in Architekturschulen nicht, die in der falschen Rationalit&Atilde;&curren;t gefangen sind.').
graph_hundertwasser_comment_en(105,'Ganz links steht vielleicht Kokoschka. Es ist mir gelungen, etwas sehr japanisch Samuraihaftes ins Bild zu bringen.').
graph_hundertwasser_comment_en(116,'Aus der &quot;Katze von Atlantis&quot; wurde &quot;Mu No Neko&quot; (die Katze von Mu, dem pazifischen Atlantis auf Japanisch). Das Ur-Bild entstand auf Santorin, in einem wei&Atilde;ÂŸen Gew&Atilde;&para;lbehaus. Santorin soll Atlantis gewesen sein. Beim Tr&Atilde;&curren;umen von Atlantis und Mu entsteht so etwas ohne mein Dazutun, eine Katze aus Mauern und Fenstern, so wei&Atilde;ÂŸ wie Kalk und Schnee.').
graph_hundertwasser_comment_en(117,'Alberto della Vecchia bereitete ein Detail des Bildes &quot;Vers&Atilde;&curren;umter Fr&Atilde;&frac14;hling&quot; f&Atilde;&frac14;r die Grundlage eines Siebdruckes vor. Die Transparentfolien mit der braunen Fotodeckfarbe blieben f&Atilde;&frac14;nfzehn Jahre in der Lade beim Drucker Barbato in Spinea, bis ich das Gewesene mit einem Zaun umgab und fertigmachte.').
graph_hundertwasser_comment_en(122,'Ein Tagtraum-Bild. Es steckt viel dahinter, doch man kann das nicht rational in Worten ausdr&Atilde;&frac14;cken, auch nicht erfassen. Ich bin sehr stolz, da&Atilde;ÂŸ so etwas unter meiner Hand entstanden ist.').
graph_hundertwasser_comment_ge(1,'Alfred Schmeller (Vice-President of the Art-Club, 1951/52 - editor&#039;s note) wanted to produce cheap graphic portfolios that anybody could afford. The painter Josef Mikl and Johann Fruhmann and I think Kurt Moldovan, too, also agreed to it. The one-cylinder zink-lithography printing process was new in Vienna. The price was ten schillings for a portfolio of ten pictures, i. e., one schilling apiece. For years nobody wanted to buy my portfolio. Fritz Wotruba was the only one who came to the &quot;Straw Valise&quot;, donated twenty schillings, but didn&#039;t want to take the portfolio with him.').
graph_hundertwasser_comment_ge(18,'Hans Neuffer was a very young man when I saw a most unusual self-portrait of his in a bookshop, which impressed me very much. I asked who it was and got to know him. His pictures were beyond all norms; some of them were even painted on newspapers (!) and surely unacceptable to any art connoisseur. He was gangly, with big hands, came from a bourgeois family and wanted to be anything but bourgeois. Through him I later got to know Udo Proksch, who was a much shadier character. Both did things which defied all convention. I made a bet with Udo and Neuffer: who would gain more influence and wield more power, me with my painting or they with money, politics and weapons. Udo is serving a life sentence, and Neuffer died a bizarre death. Who won the bet? As to Udo Proksch, he was convicted of sinking the ship Lucona in the Indian Ocean in an insurance-fraud scheme, and six seamen drowned. I must truthfully say to all this that there must be two souls in his breast. He used his position as a darling of the Austrian government to do good things, too, e.g., to prevent a police raid on the squatters in the wetlands (Hainburg, 1984, editor&#039;s note). I also have him to thank for helping to speed up arranging my meetings with Chancellor Kreisky and Mayor Gratz concerning the construction of the Hundertwasser House. So I have been connected directly or indirectly with four boats: the Rossauerl&Atilde;&curren;nde ferry, the S.S. Bauta, on which I was a seaman, the Regentag, with which I sailed to New Zealand and, albeit from a distance, the Lucona (see also 529 [??: dieses Lemma ist 529!] Spiral with Neuffer Heads)').
graph_hundertwasser_comment_ge(24,'The typical French method of graphic-edition fraud infuriated me. I wanted to set a good example and do it honestly. It was (and is) common practise to divide a graphic up into several series and number them separately to make it look like it is a small edition. These partial series, each numbered separately from the beginning, claiming to be an exclusive edition of the graphic in question, had imaginative names such as: grand marge (the same graphic printed on larger-format paper), pour l&#039;artiste (same graphic again), &Atilde;&copy;preuve d&#039;artiste (same graphic again, not really proofs), h. c. - hors commerce (they were put on the market anyway), on different and different-coloured paper, &quot;Japanese&quot;, &quot;vat - handmade - paper&quot;, signed, print-signed, as poster print (same graphic printed on poor-quality paper), in addition to the normal print run (the smaller the better). If you count up all these special print runs of the same graphic, the indicated quantity of the edition is multiplied many times over. I did that, which made the world of French graphics dealers very angry with me: I just numbered everything all the way through and indicated the real quantity of the edition on each print.').
graph_hundertwasser_comment_ge(34,'This was the beginning of a long period of working together with my friend, the &quot;Coordinatore&quot; Alberto Della Vecchia. Up to that time I had resisted doing graphics. What had been done in this line hitherto had come about more or less because I had no choice. Until Alberto brought me a &quot;Hundertwasser graphic&quot; he had done. I immediately felt ill: this was kitsch which aped my style. Nonetheless, it was the decisive impetus to do it better, to do it right. Thus &quot;King Kong&quot; came to be.').
graph_hundertwasser_comment_ge(36,'An homage to Walter Kampmann, who gave me the soul-trees. He died when the Red Army marched in, in 1945, east of Berlin. It would be wonderful to meet him in the rain among his soul-trees.').
graph_hundertwasser_comment_ge(40,'I was always very happy when I was able to combine different forms of expression I had created. This is the boat Regentag and the spiral as a maelstrom. It is nice when you can fall back on your own creations. It is your own territory that you stand on and can walk around in.').
graph_hundertwasser_comment_ge(41,'This is my first large print edition, which I numbered from beginning to end; but actually it isn&#039;t one, since it consists of many variations. It is based on 151 Bleeding Houses. I spent months in the print shop in Campalto, while the Regentag lay in berth not far away, in a canal of the lagoon near Ca&#039; Noghera. It was like a simultaneous chess match with more than forty opponents. I did this even more radically later with the silkscreen print 860 Homo Humus come va. I don&#039;t think anyone can outdo me in this gigantic enterprise, which took up two years of my life. I used completely new techniques in print graphics: metallic-stamp printing, phosphorescent colours that glow in the dark, reflecting glass-bead appliqu&Atilde;&copy;s, convex embossing and an incredible number of colour overprints which I painted separately on transparent foil, from where they were transferred to the screen. Then the proofs of the infinite number of colour combinations. I wanted to reduce the conveyor belt to absurdity. I got myself into a bind between the incredible demand which had materialised and my pride in creating something original, not mass-produced, and I wanted to give as much of my inner self as I could. I went to court and won because I wanted to keep the prices low (just like with the Art Club portfolio of 1951) - 100 marks per print, to make it accessible to many people. It was all for nought. I could not fix the price on the open market. It was a victory and a defeat all in one.').
graph_hundertwasser_comment_ge(53,'An odd premonition: the drops of blood on the poster I painted before the massacre during the Olympic Games. It is based on my picture 147 The Match of the Century. In the middle of it I painted in the orthodox church which &quot;Father Timofey&quot;, a self-willed, self-proclaimed Russian-orthodox priest, had built in defiance of any building permit right in the middle of where the Olympic Games were to take place. However, the love of the people of Munich prevented the church from being torn down. Several times I visited him and his onion turrets, whose outside covering consisted of shiny tinfoil from chocolate wrappings. I felt my predilection for gold and silver and metal-stamping confirmed. It was a holy feeling.').
graph_hundertwasser_comment_ge(55,'One of the few pictures I painted together with other painters, such as with Br&Atilde;&acute;, or where others just added something to my pictures, such as Neuffer or Kito. In this silkscreen print I only did the margin and the bottom portion and printed the apples in metallic-stamping. Sonnenstern did an Adam, a man with a head, but withered and barren, and this woman, Eve, who may have no head, but is full of fruits and blossoms.').
graph_hundertwasser_comment_ge(64,'My division of labour for print-graphics production was in full force: Japan for wood-block prints, Paris for lithography, Venice for silkscreen printing and Vienna for engraving and copperplate engraving. I think there is no better way of dividing up and utilising the traditional mastery in the various sectors of print graphics.').
graph_hundertwasser_comment_ge(67,'The Death of Thousand Windows (1973)  Green Rain Falls Green Rain Falls Only on Violet Roofs Green Rain Runs Only over Black Walls Green Rain Runs into Thousand Dying Windows Green Rain Fills Thousand Flats with Emerald  The Sun Is Only Beautiful when she Falls The Sun Is Most Beautiful when it Rains Windows Are Most Beautiful when They Have A Fever and Die Water Is Most Beautiful when the Town Drowns in it Green Is Most Beautiful when Living Window Panes Sink into Deep Water  The Prairie Covers the Rain with its Green Skin The Prairie Knows all Thousand Windows Do Not Stumble over the Waves Walk over the Prairie with Care so that the Green Does Not Break (from: Cat. Aberbach Fine Art, New York, 1973)').
graph_hundertwasser_comment_ge(78,'As a reader of Karl May&#039;s &quot;Winnetou&quot; as a lad, I was very moved by the tragedy of the Indians, and thoughts and images on this subject come to me spontaneously, in strange mutations, in a way similar to my Dalai Lama pictures. They are not directly confrontational and accusing pictures, but dream pictures transformed in the subconscious. How that happens in waking moments I cannot explain. (see also 586)').
graph_hundertwasser_comment_ge(82,'These signing days are not included in the days of work indicated on the reverse side. To give his fingers and spirit a break, Hundertwasser interrupted the signing once he reached a significant stage in the numbering and went with Alberto to have a cup of coffee in the arcade caf&Atilde;&copy; Bella Venezia. A bottle of sparkling wine was kept on ice for this occasion, too, but remained unopened. Hundertwasser applied the date stamp and signed with home-made india ink, which he obtained using liquid soot which dripped from his stovepipe. He used a rubber stamp to correct the printed number 10001 to 10002 and a Japanese stamp with an inkan, the Japanese ink pad. The sheets were stacked in tens, and 50 formed a row of 5 stacks of 10 on a long table in a separate room, to facilitate the signing and stamping. Sets of ten sheets were then fanned out and carried back to the printshop to dry the soot-ink signature and the Japanese stamp by laying them on drying shelves. Alberto lent a hand in this. (from: brochure on 860 Homo Humus come va, Die Galerie, Offenbach on the Main, 1984)  This was a strenuous effort which can hardly be imagined: ten thousand originals in one edition. Just signing them all took eighteen days in the course of two months.').
graph_hundertwasser_comment_ge(83,'Bees see many images at the same time. The city, with its many windows, is reflected in the face of the city-man - that is me, apparently. If Picasso can unfold faces, one can also show on the face what the face sees. What one sees and one&#039;s surroundings unite with the soul of the person they surround, as it is. That is why one grows ugly and sick when one is exposed to visual pollution. People don&#039;t learn that at the architecture schools, which are caught up in false rationality.').
graph_hundertwasser_comment_ge(105,'That might be Kokoschka on the far right. I succeeded in bringing something very Japanese and samurai-like into the picture.').
graph_hundertwasser_comment_ge(116,'The &quot;Cat of Atlantis&quot; became &quot;Mu No Neko&quot; (The Cat of Mu, the Japanese name for the Atlantis of the Pacific). The original painting was painted on Santorin in a white cave-house. Santorin is said to have been Atlantis. While dreaming about Atlantis and Mu, a painting like this comes about of its own accord: a cat consisting of walls and windows, as white as chalk or snow.').
graph_hundertwasser_comment_ge(117,'Alberto della Vecchia prepared a detail of the painting &quot;Missed Spring&quot; as the basis for a silk-screen print. The transparent foils with the brown opaque ink remained in a drawer at the printer&#039;s , Barbato in Spinea, for fifteen years, until I put a fence around the whole and finished it.').
graph_hundertwasser_comment_ge(122,'A daydream painting. There is a lot behind it, but it cannot be expressed rationally in words nor even comprehended. I am very proud that a thing like this has come about by my own hand.').
