graph_information_en(1,'Proofs as well as a number of excess and deficient specimens were produced during the printing of the portfolio. This makes it impossible to provide a reliable record of each portfolio edition today. Very few complete portfolios exist.').
graph_information_en(12,'Printing commissioned by the publishers. The original watercolour was cut into pieces for 577 La Lune Rodage The artist was retributed with 600 Austrian Shillings and 10 artist proofs for the edition. One proof was in commission at the Galleria Obelisco in Rome in August, 1954, for Lit. 6,000. In November, 1954, the linocut was offered by the Neue Galerie Kasten in Linz for ATS 100.').
graph_information_en(13,'Sheets of the edition have been cut: Format and image: 50 x 38 cm Proofs have full size').
graph_information_en(14,'In 1958-59 three incomplete proof prints were overpainted by the artist. First identified as 305A, 305B and 305C, the three watercolours over lithographs were subsequently entered in the works catalogue as 591, 592 and 593. There are also two forged watercolours; two prints were anonymously painted over in watercolours and sold as Hundertwasser works.').
graph_information_en(15,'Carl L&Atilde;&iexcl;szl&Atilde;&sup3;, Kunsth&Atilde;&curren;ndler in Basel, lie&Atilde;ÂŸ eine Dalai-Lama-Ausgabe der Zeitschrift  Panderma enstehen, der eine Originallithographie Hundertwassers zum Thema der Flucht des Dalai-Lama beigelegt werden sollte. Der K&Atilde;&frac14;nstler konzipierte das Blatt so, da&Atilde;ÂŸ es quer in der Mitte durchgeschnitten, der untere Teil links an den oberen zu einem L&Atilde;&curren;ngsformat geklebt und gefaltet, eingef&Atilde;&frac14;gt werden konnte. (28 x 118 cm)').
graph_information_en(23,'Zus&Atilde;&curren;tzliche  66 St&Atilde;&frac14;ck (33 von jeder Farbvariante) wurden, unsigniert und nicht nummeriert, in St&Atilde;&frac14;cke geschnitten und auf die Vorderseiten des Schachtelbuches  638 A Hauteurs de Machu Picch&Atilde;&ordm; geklebt, siehe APA 85.').
graph_information_en(24,'After the painting Nr. 344 Nostalgie de l&#039;au dela: taken off the outer spirals replaced with windows; goint farther than the margin. Taken off 2 central part replaced with spirals and smoke. Taken off lower part and right edge, replacing it with 2 faces, one ship, and a fence. On the pl. wrongly numbered 633.').
graph_information_en(26,'After the painting no. 635 Ma jiz nektere snalosti cestiny, Adding personally green hair on the bald head and a beard; changed the white tower on the right side of the head from white to black. Omitted the spider net under the head; a face in one window. I worked on the windows, making more of them black; added several inscriptions: Marta, and som black drops.').
graph_information_en(27,'Done after the painting no. 626, Das ist der Weg zu Dir, I designed personally three more buttons on the yellow car representing mouths. The green stripes in the silver roof of the car got red bands. I omitted the stripes in the pink sky. The uniforme black right of the yellow board I made blue inside. I changed the win screen wipers from dark violet to blue. The red spot on the upper side got black (and other miror changes).').
graph_information_en(28,'Done after the painting no. 634, Marta spatri sveho pritele; Under my orders exchanged the light blue sky from right to left, the dark blue sky from left to right. Put a yellow ball on top of the middle cupola; changed the top of the small cupola, put a green cupola on top of the right cupola. changed the colour of the two big cupolas: in the centre from violet to transparent brown, on the right from dark blue to transparent green; changed the top ot the left cupola; put green spots on the white face. Changed the lower row of the windows from copper to gold. Designed te left cupola out of margin and continued the band between the first and the second window rows into the white outer space towards the signature yellow.').
graph_information_en(29,'Done after painting no. 654, the Jukebox; I designed personally green and brown &quot;Teeth&quot; into the outer white space on the right, a big brown tooth from the lower left conrer onto outer white space. The certer girl got green and red hair along the spiral beginning. I put green spots into the pink spiral bands on the right side and added an irregular brown edge down, and other colour changes.').
graph_information_en(30,'Done after the painting no. 657 The night of the woman drinker: I changed the colour of the bottles. I changed all black stars to red. I changed the orange and red colours of all the windows in the face: each window got the colour of one of the litho plates, there are more than 15 different colours. I designed the yellow neck dowards into the white outer space. The nose hole got light blue. The blue hair of the last three down rows is falling vertically down instead of into the left. Other minor colour changes.').
graph_information_en(64,'The artist donated half of the edition for the benefit of the Association of Albertina Patrons.').
graph_information_en(69,'Das Buch umfa&Atilde;ÂŸt 114 Seiten, alle Farbholzschnitte bis 1975 in Farbreproduktionen mit Textbeitr&Atilde;&curren;gen verschiedener Autoren und einer Liste von Meisterhandwerkern, die mit der Herstellung befa&Atilde;ÂŸt waren.').
graph_information_en(82,'sold at Germann&#039;s for SFr. 2.400,--/October 26, 1989').
graph_information_en(89,'Size with passepartout: 700 x 500 mm').
graph_information_en(97,'Herausgegeben zur finanziellen Unterst&Atilde;&frac14;tzung der Umgestaltung der St. Barbara Kirche in B&Atilde;&curren;rnbach. Pr&Atilde;&curren;sentiert in der Galerie Hilger in Wien, am 4. Dezember 1987.').
graph_information_en(123,'Die folgenden Originale: Laptop, June 6, 1998 Kamaia Honda, June 10, 1998 Air China, July 2, 1998  Modem, July 5, 1998 B?, August 1998 Susuka, August 12, 1998 gingen am 20. November 1998 an Finger.  3. Juni?/3.6.1998 Bad Run/14.6.1998 Komputer/30.6.1998 167/15.7.1998 wurden von Finger im November 1998 erarbeitet.').
graph_information_ge(15,'Carl L&Atilde;&iexcl;szl&Atilde;&sup3;, art dealer at Basel, arranged for the periodical Panderma to publish an issue on the Dalai Lama to be accompanied by an original Hundertwasser lithograph on the subject of his escape. The artist designed the sheet so that, cut horizontally along the centre, the lower part stuck to the left of upper part to achieve a longitudinal format, it could be folded to fit in as a supplement (28 x 118 cm).').
graph_information_ge(23,'An additional 66 (33 of each colour variant), unsigned and not numbered, were cut into pieces and glued onto the fronts of the nest of boxes 638 A Hauteurs de Machu Picch&Atilde;&ordm;, see APA 85').
graph_information_ge(69,'The book comprises 114 pages, the complete woodcut oeuvre up to 1975 in colour reproductions, text contributions by various authors, and a list of the master artisans engaged in the production.').
graph_information_ge(97,'Donated for funds for the construction of the Church of St. Barbara in B&Atilde;&curren;rnbach. Presented at Galerie Hilger, Vienna, December 4, 1987.').
